import React, { useState } from "react";
import "./List.css";

function List({ data }) {
  const [isExpand, setExpand] = useState(-1);

  const handleListExpand = (index) => {
    console.log(isExpand, index);
    setExpand(index);
  };

  return (
    <div className="list__container">
      <ul className="list__items">
        {data.map((d, index) => (
          <li
            className="list__item"
            key={index}
            onClick={() => handleListExpand(index)}
          >
            {d.title}
          </li>
        ))}
        {isExpand !== -1 && (
          <ul>
            {data.map((d, index) => (
              <List data={d[isExpand].child} />
            ))}
          </ul>
        )}
      </ul>
    </div>
  );
}

export default List;
